import React from 'react';
import CFImage from './CommuteForecast.GIF';

function CommuteForecast(props) {
    return (
        <div>
          <h1>CommuteForecast</h1>
          <img src={CFImage} alt="CFImage" />
        </div>
      )
}



export default CommuteForecast;
